import { Schema, model, Document } from "mongoose";
import { customerSchema } from "./customer.js";
import { providerSchema } from "./provider.js";
import { furnitureSchema } from "./furniture.js";

export interface FurnitureTuple {
  furniture: typeof furnitureSchema;
  quantity: number;
}

interface ITransaction extends Document {
  type: "Purchase" | "Sale";
  furniture: FurnitureTuple[];
  customer?: typeof customerSchema;
  provider?: typeof providerSchema;
  date: Date;
  price: number;
}

export const transactionSchema = new Schema<ITransaction>({
  type: {
    type: String,
    enum: ["Purchase", "Sale"],
    required: true,
  },
  furniture: [
    {
      furniture: {
        type: Schema.Types.ObjectId,
        ref: "Furniture",
        required: true,
      },
      quantity: {
        type: Number,
        required: true,
      },
    },
  ],
  customer: {
    type: Schema.Types.ObjectId,
    ref: "Customer",
  },
  provider: {
    type: Schema.Types.ObjectId,
    ref: "Provider",
  },
  date: {
    type: Date,
    required: true,
  },
  price: {
    type: Number,
    required: true,
  },
});

export default model<ITransaction>("Transaction", transactionSchema);

import { Document, model, Schema } from "mongoose";
import validator from "validator";

interface IProvider extends Document {
  name: string;
  contact: string;
  postalCode: string;
  cif: string;
}

export const providerSchema: Schema = new Schema<IProvider>({
  name: { type: String, required: true },
  contact: {
    type: String,
    required: true,
    validate: {
      validator: (value: string) => {
        return validator.isMobilePhone(value, "any");
      },
      message: "Invalid phone number",
    },
  },
  postalCode: {
    type: String,
    required: true,
    validate: {
      validator: (value: string) => {
        return validator.isPostalCode(value, "any");
      },
      message: "Invalid address",
    },
  },
  cif: {
    type: String,
    required: true,
    validate: {
      validator: (value: string) => {
        return (
          validator.isAlphanumeric(value) &&
          value.length === 9 &&
          value[0] === value[0].toUpperCase()
        );
      },
      message: "Invalid CIF",
    },
  },
});

export default model<IProvider>("Provider", providerSchema);

